import React, { Component } from "react";
import "./node.css";

class Node extends Component {
  state = {};

  render() {
    let grids = [];
    for (let i = 0; i < 1000; i++) {
      grids.push(<div class="node"></div>);
    }

    return grids;
  }
}

export default Node;
